webpackJsonp([0x88bd48f81889],{801:function(a,n){a.exports={data:{markdownRemark:{frontmatter:{title:"V KL'UVIKAH",type:"lyrics"},html:"<h1>V&nbsp;KLJUVIKAH</h1>\n<section>\n<p>Odnazhdy ja prosnulsja naraspev!<br>\nSluchajno ja prosnulsja naraspashku — <br>\nmne vsjo kazalos' talym, kak vo sne,<br>\ni mjatym, slovno rukava rubashki.</p>\n<p>A ja byl zaponkoj zheleznoj i sverchkom!<br>\nJa svechkoj byl! Ja utru byl ne raven!<br>\nOno menja budilo majakom,<br>\na ja perebolel, perenapravil.</p>\n<p>Da, ja prosnulsja, no sovsem ne spal,<br>\ni vysunulsja v seredinu utra.<br>\nJa vstal nogami prjamo na divan<br>\ni zakrichal, chto schastliv byl kak budto!</p>\n</section>"},site:{siteMetadata:{languages:{defaultLangKey:"en",langs:["en","ru"]}}}},pathContext:{slug:"/en/lyrics/vKluvikah/"}}}});
